import React from 'react';
import ReactDOM from 'react-dom';

const date = new Date();
const hour = date.getHours();
console.log(hour);

let greet = "";
var colour =""

if (hour >= 0 && hour < 12) {
  greet = "Good morning";
  colour="red"
} else if (hour >= 12 && hour < 18) {
  greet = "Good afternoon";
  colour="blue"
} else {
  colour="green"
  greet = "Good evening";
}

const styler={
  color:colour
}

ReactDOM.render(
  <div>
    <h1 style={styler}>{greet}</h1>
  </div>,
  document.getElementById("root")
);
